import { Link } from 'react-router-dom';

function HomeScreen() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Zodiacus</h1>
      <p>Bienvenido a Zodiacus</p>
      <Link to="/register">
        <button style={{ padding: 10, backgroundColor: '#DAA520', color: 'white', border: 'none', borderRadius: 4 }}>
          Ir a Registro
        </button>
      </Link>
    </div>
  );
}

export default HomeScreen;
